function App() {
  state={
    categories:[
      {
        id:'cat1',
        name:'market'
      },
      {
        id:'cat2',
        name:'school'
      }
    ]
  }
  return (
    <div className="App">
      <Header />
      <Tabs />
      <div className="container is-fluid">
        <div className="notification">
          <Tasklist />
          <Edits/>
        </div>
      </div>

    </div>
  );
}

export default App;
